description:
Becoming Woman in Zanskar

Culture Documentary hosted by Paul Bandey, published by ZED in 2007 - English narration


Information
------------------------------

&quot;Becoming Woman in Zanskar&quot; recounts the moving story of a friendship shattered by destiny when two best friends have to part and to leave their families forever... Tenzin will be married to a man she hasn't chosen while Palkit will become a nun. Two adolescents in the Himalayas : one kidnapped by her future husband, the other head shaved as she enter the covent forever.

